import { NgModule } from '@angular/core';

import { ButtonModule } from 'primeng/button';
import { ConfirmationService, MessageService } from 'primeng/api';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { DialogService } from 'primeng/dynamicdialog';
import { IcCodeService } from 'app/ng-connect';
import { SplitterModule } from 'primeng/splitter';
import { InputTextModule } from 'primeng/inputtext';
import { DividerModule } from 'primeng/divider';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { CardModule } from 'primeng/card';
import { FileUploadModule } from 'primeng/fileupload';
import { HttpClientModule } from '@angular/common/http';
import { InputTextareaModule } from 'primeng/inputtextarea';
import { MessagesModule } from 'primeng/messages';
import { MessageModule } from 'primeng/message';
import { VesRoutingModule } from './route/ves-routing.module';
import { CheckboxModule } from 'primeng/checkbox';
import { PanelModule } from 'primeng/panel';
import { VesComponent } from './ves.component';
import { OverlayPanelModule } from 'primeng/overlaypanel';
import { VirtualScrollerModule } from 'primeng/virtualscroller';
import { ScrollPanelModule } from 'primeng/scrollpanel';
import { TableModule } from 'primeng/table';
import { ChipModule } from 'primeng/chip';
import { CommonModule } from '@angular/common';
import { SharedModule } from 'app/shared/shared.module';
import { VesRecordDeleteComponent } from './ves-record-delete/ves-record-delete.component';
import { VesRecordEditComponent } from './ves-record-edit/ves-record-edit.component';
import { CalendarModule } from 'primeng/calendar';
import { VesPassDataService } from './service/ves-pass-data.service';
import { MultiSelectModule } from 'primeng/multiselect';
// import { VesViewFilterService } from './service/ves-view-filter.service';
import { DatePipe } from '@angular/common';
import { RemarkTruncatePipe } from './pipe/remark-truncate.pipe';
import { PendingVesRequestComponent } from './pending-ves-request/pending-ves-request.component';
import { CreateVesRequestComponent } from './create-ves-request/create-ves-request.component';
import { AmendVesRequestComponent } from './amend-ves-request/amend-ves-request.component';
import { ApproveVesRequestComponent } from './approve-ves-request/approve-ves-request.component';

@NgModule({
    imports: [
        CommonModule,
        SharedModule,
        VesRoutingModule,
        SplitterModule,
        InputTextModule,
        DividerModule,
        CardModule,
        FileUploadModule,
        HttpClientModule,
        InputTextareaModule,
        MessagesModule,
        MessageModule,
        PanelModule,
        FormsModule,
        ReactiveFormsModule,
        CheckboxModule,
        OverlayPanelModule,
        VirtualScrollerModule,
        ScrollPanelModule,
        TableModule,
        ChipModule,
        CalendarModule,
        MultiSelectModule,
    ],
    declarations: [
        VesComponent,
        ApproveVesRequestComponent,
        CreateVesRequestComponent,
        AmendVesRequestComponent,
        PendingVesRequestComponent,
        VesRecordDeleteComponent,
        VesRecordEditComponent,
        RemarkTruncatePipe
    ],
    providers: [
        ConfirmationService,
        MessageService,
        NspConfirmationService,
        DialogService,
        IcCodeService,
        VesPassDataService,
        // VesViewFilterService,
        DatePipe,
        ButtonModule
    ]
})
export class VesModule {
}
